import React from 'react';

function Email(props){
    return(
    <div className="container mb-3">
        <div className="card p-3">
            <p> 
                <b>Name</b>  : 
                {props.name}
            </p>
            <p>
                <b>EMail</b> : 
            {props.email} 
            </p>
       <button className="btn-sm btn-secondary">
           delete
       </button>
        </div>
    </div>

    )
}


export default Email;
